import Userbar from "../Userbar";
import Dashboard from "../Sidebarcomps/Dashboard"
import { useState } from "react";

export default function AdminPage(){
    const [showComponent, setShowComponent] = useState(false);
    return(
        <div className="flex">
            <AdminSidebar/>
            <Userbar/>
            
            <Dashboard/>
        </div>
    )
}
